import React, {FC, ReactElement} from "react";
import { Box, Typography, Stack} from "@mui/material";
import {TitleField} from "../interfaces/titleField";
import {DescriptionField} from "../interfaces/descriptionField";
import {DateField} from "../interfaces/dateField";
import {SelectField} from "../interfaces/selectField";

export const CreateRoleForm: FC = (): ReactElement => {
    return (
        <Box
            display={"flex"}
            flexDirection={"column"}
            alignItems={"flex-start"}
            width={"100%"}
            px={4}
            my={6}
            >
            <Typography mb={2} component={"h2"} variant={"h6"}>
                Create A Role
            </Typography>
            <Stack sx={{ width: '100%'}} spacing={2}>
                <TitleField/>
                <DescriptionField/>
                <DateField/>
                <Stack
                    sx={{ width: '100%'}}
                    direction={"row"}
                    spacing={2}
                >
                    <SelectField
                    label={"Status"}
                    name={"status"}
                    items={[
                        {
                            value: "option1",
                            label: "option1",
                        },
                        {
                            value: "option2",
                            label: "option2",
                        },
                    ]}
                    />
                    <SelectField
                        label={"priority"}
                        name={"priority"}
                        items={[
                            {
                                value: "priority1",
                                label: "priority1",
                            },
                            {
                                value: "priority2",
                                label: "priority2",
                            },
                        ]}/>

                </Stack>
            </Stack>
        </Box>
    )
}
